import React from "react";
import "./Meme.css"

function Meme(props) {
    return(
        <div>
            <img
                className = "memeImage"
                alt = ""
                src = {props.url}
            />

        <div class="centered">Centered</div>
        </div>
    );
}

export default Meme;
